MIRPUR [AJK], Dec 21 (APP):: President of Pakistan Muslim League-Nawaz (PML-N), AJK chapter, Shah Ghulam Qadir was called on President Azad Jammu and Kashmir Barrister Sultan Mahmood Chaudhry at Jammu Kashmir House here Thursday.
During the meeting, they discussed in detail the issues of mutual interest and prevailing political situation in the region. Muhammad Ahmad Raza Qadri was also present on the occasion.
